// WMO CODE TO ICON LOOKUP
// =============================================================================

/**
 * Get icon array for WMO weather code
 * @param wmoCode WMO weather interpretation code (0-99)
 * @return Pointer to RGB565 icon array, or nullptr if unknown code
 */
inline const uint16_t* getIconForWMOCode(int wmoCode) {
    switch (wmoCode) {
        case 0: return icon_wmo_0;
        case 1: return icon_wmo_1;
        case 2: return icon_wmo_2;
        case 3: return icon_wmo_3;
        case 45: return icon_wmo_45;
        case 48: return icon_wmo_48;
        case 51: return icon_wmo_51;
        case 53: return icon_wmo_53;
        case 55: return icon_wmo_55;
        case 56: return icon_wmo_56;
        case 57: return icon_wmo_57;
        case 61: return icon_wmo_61;
        case 63: return icon_wmo_63;
        case 65: return icon_wmo_65;
        case 66: return icon_wmo_66;
        case 67: return icon_wmo_67;
        case 71: return icon_wmo_71;
        case 73: return icon_wmo_73;
        case 75: return icon_wmo_75;
        case 77: return icon_wmo_77;
        case 80: return icon_wmo_80;
        case 81: return icon_wmo_81;
        case 82: return icon_wmo_82;
        case 85: return icon_wmo_85;
        case 86: return icon_wmo_86;
        case 95: return icon_wmo_95;
        case 96: return icon_wmo_96;
        case 99: return icon_wmo_99;
        default: return icon_wmo_3;  // Fallback to overcast
    }
}

